import React, { useEffect, useState } from 'react'

import ItemList from '../../components/ItemList';

import './styles.css';
import { useParams } from 'react-router-dom';

import { db } from '../../firebase/config';
import { collection, query, where, getDocs } from "firebase/firestore";


const ItemListContainer = ({greeting}) => {

  console.log(db)
  

  const[productos, setProductos] = useState([])

  const {categoryId} = useParams();
  console.log(categoryId);

   /*  const products = [

        {id:'01', name:'Televisor Samsung 32',price:"$30000", description: 'TV led 32 Android', img:'data:image/jpeg;base64,'},

        {id:'02', name:'Televisor Samsung 43',price:"$40000", description: 'TV led 43 Android', img:'data:image/jpeg;base64,'},

        {id:'03', name:'Televisor Samsung 50', price:"$50000", description: 'TV led 50 Android', img:'data:image/jpeg;base64,'},

        {id:'04', name:'Televisor Samsung 65',price:"60000", description: 'TV led 65 Android', img:'data:image/jpeg;base64,'},

        {id:'06', name:'Televisor Samsung 75', price:"$70000", description: 'TV led 75 Android', img:'data:image/jpeg;base64,'},

        {id:'07', name:'Televisor Samsung 85',price:"$90000", description: 'TV led 85 Android', img:'data:image/jpeg;base64,'},

        ] */



        useEffect(()=> {
    
          (async ()=> {
          
              try {

                  const q = categoryId ? 
                  query(collection(db, "products"), where("category", "==", categoryId))
                  :
                  query(collection(db, "products" )); 

                
                  const querySnapshot = await getDocs(q);
                  const productosFirebase = [];
                  querySnapshot.forEach((doc) => {
                    // doc.data() is never undefined for query doc snapshots
                    console.log(doc.id, " => ", doc.data());
                    productosFirebase.push({id: doc.id, ...doc.data()})
                  });
                  console.log(productosFirebase);
                   setProductos(productosFirebase);

               //   const response = await fetch(
               //   "https://fakestoreapi.com/products/category/" + categoryId
               //);

                //     const productos = await response.json();
                //  setProductos(productos); 
                
               
              }  catch (error) {
                console.log(error);
              }
      
            })();
      
        }, [categoryId])
      
        console.log(productos)

  return (

    <div>

        <h1>{greeting}</h1>

       

        <ItemList products={productos} />

    </div>

  )

}



export default ItemListContainer;